<p>将逻辑层的数据反应成视图，同时将视图层的事件发送给逻辑层。</p>
<ul>
<li>
<p>WXML (WeiXin Markup language) 用于描述页面的结构。</p>
</li>
<li>
<p>WXS (WeiXin Script) 是小程序的一套脚本语言，结合 WXML，可以构建出页面的结构。</p>
